contracts/RentalAgreement.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract RentalContract {
    // Rental Agreement variables
    address public tenant;
    address public landlord;
    string public propertyDetails;
    uint public startDate;
    uint public endDate;
    uint public rentAmount;
    uint public lastPaymentTimestamp;
    uint public dueInterval; // in days
    bool public isActive;

    // Payment Log variables
    struct Payment {
        uint amount;
        uint timestamp;
        address payer;
    }
    
    Payment[] public payments;

    // Events
    event AgreementCreated(address indexed tenant, address indexed landlord, uint startDate, uint endDate);
    event AgreementEnded(uint timestamp);
    event PaymentRecorded(uint amount, uint timestamp, address payer);

    modifier onlyParties() {
        require(msg.sender == tenant || msg.sender == landlord, "Only tenant or landlord can call this");
        _;
    }

    modifier onlyLandlord() {
        require(msg.sender == landlord, "Only landlord can call this");
        _;
    }

    function createAgreement(
        address _tenant,
        string memory _propertyDetails,
        uint _startDate,
        uint _endDate,
        uint _rentAmount,
        uint _dueInterval
    ) external {
        require(_tenant != address(0), "Invalid tenant address");
        require(_startDate < _endDate, "End date must be after start date");
        require(_rentAmount > 0, "Rent amount must be greater than zero");
        require(_dueInterval > 0, "Due interval must be greater than zero");
        
        landlord = msg.sender;
        tenant = _tenant;
        propertyDetails = _propertyDetails;
        startDate = _startDate;
        endDate = _endDate;
        rentAmount = _rentAmount;
        dueInterval = _dueInterval * 1 days; //Remove the ( 1 days ) part to do in seconds
        isActive = true;

        emit AgreementCreated(tenant, landlord, startDate, endDate);
    }

    function endAgreement() external onlyParties {
        require(isActive, "Agreement already ended");
        isActive = false;
        emit AgreementEnded(block.timestamp);
    }

    function recordPayment() external payable onlyParties {
        require(isActive, "Agreement is not active");
        
        // Log the payment
        Payment memory payment = Payment({
            amount: msg.value,
            timestamp: block.timestamp,
            payer: msg.sender
        });
        
        payments.push(payment);
        
        // Update last payment timestamp
        lastPaymentTimestamp = block.timestamp;
        
        emit PaymentRecorded(msg.value, block.timestamp, msg.sender);
    }

    function verifyRentStatus() public view returns (string memory) {
        uint lastPaid = lastPaymentTimestamp > 0 ? lastPaymentTimestamp : startDate;
        uint nextDue = lastPaid + dueInterval;

        if (block.timestamp < nextDue) {
            return "Paid";
        } else {
            return "Missed";
        }
    }
    
    function getContractAddress() public view returns (address) {
        return address(this);
    }
    
    // Get number of payments
    function getPaymentCount() external view returns (uint) {
        return payments.length;
    }
    
    // Get payment details by index
    function getPaymentByIndex(uint index) external view returns (
        uint amount,
        uint timestamp,
        address payer
    ) {
        require(index < payments.length, "Payment index out of bounds");
        Payment storage payment = payments[index];
        
        return (payment.amount, payment.timestamp, payment.payer);
    }
    
    // Get all payments (returns separate arrays)
    function getAllPayments() external view returns (
        uint[] memory amounts,
        uint[] memory timestamps,
        address[] memory payers
    ) {
        uint count = payments.length;
        
        amounts = new uint[](count);
        timestamps = new uint[](count);
        payers = new address[](count);
        
        for (uint i = 0; i < count; i++) {
            amounts[i] = payments[i].amount;
            timestamps[i] = payments[i].timestamp;
            payers[i] = payments[i].payer;
        }
        
        return (amounts, timestamps, payers);
    }
}

contracts/TenantReview.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IRentalAgreement {
    function landlord() external view returns (address);
    function tenant() external view returns (address);
    function isActive() external view returns (bool);
    function endDate() external view returns (uint);
}

contract TenantReview {
    struct Review {
        address reviewer;     // Landlord address
        address tenant;       // Tenant address
        uint rating;          // Rating (e.g., 1-5)
        string comments;      // Additional comments
        uint timestamp;       // When the review was created
        address rentalContract; // Reference to the rental agreement
    }

    // Mapping from tenant address to array of reviews
    mapping(address => Review[]) public tenantReviews;
    
    event ReviewAdded(address indexed tenant, address indexed reviewer, uint rating);

    function addReview(
        address rentalContractAddress,
        uint rating,
        string memory comments
    ) external {
        IRentalAgreement rentalAgreement = IRentalAgreement(rentalContractAddress);
        
        // Verify the reviewer is the landlord from the rental agreement
        require(msg.sender == rentalAgreement.landlord(), "Only the landlord can leave a review");
        
        // Can only review after rental has ended or is inactive
        require(
            !rentalAgreement.isActive() || block.timestamp > rentalAgreement.endDate(),
            "Can only review after rental period ends"
        );
        
        // Rating must be between 1 and 5
        require(rating >= 1 && rating <= 5, "Rating must be between 1 and 5");
        
        address tenantAddress = rentalAgreement.tenant();
        
        Review memory newReview = Review({
            reviewer: msg.sender,
            tenant: tenantAddress,
            rating: rating,
            comments: comments,
            timestamp: block.timestamp,
            rentalContract: rentalContractAddress
        });
        
        tenantReviews[tenantAddress].push(newReview);
        
        emit ReviewAdded(tenantAddress, msg.sender, rating);
    }
    
    // Updated function to return decomposed review data
    function getTenantReviews(address tenant) external view returns (
        address[] memory reviewers,
        uint[] memory ratings,
        string[] memory commentsList,
        uint[] memory timestamps,
        address[] memory rentalContracts
    ) {
        Review[] storage reviews = tenantReviews[tenant];
        uint reviewCount = reviews.length;
        
        // Initialize arrays with the correct size
        reviewers = new address[](reviewCount);
        ratings = new uint[](reviewCount);
        commentsList = new string[](reviewCount);
        timestamps = new uint[](reviewCount);
        rentalContracts = new address[](reviewCount);
        
        // Populate the arrays with data from the reviews
        for (uint i = 0; i < reviewCount; i++) {
            reviewers[i] = reviews[i].reviewer;
            ratings[i] = reviews[i].rating;
            commentsList[i] = reviews[i].comments;
            timestamps[i] = reviews[i].timestamp;
            rentalContracts[i] = reviews[i].rentalContract;
        }
        
        return (reviewers, ratings, commentsList, timestamps, rentalContracts);
    }
    
    // Additional helper function to get a specific review by index
    function getTenantReviewByIndex(address tenant, uint index) external view returns (
        address reviewer,
        uint rating,
        string memory comments,
        uint timestamp,
        address rentalContract
    ) {
        require(index < tenantReviews[tenant].length, "Review index out of bounds");
        
        Review storage review = tenantReviews[tenant][index];
        
        return (
            review.reviewer,
            review.rating,
            review.comments,
            review.timestamp,
            review.rentalContract
        );
    }
    
    // Get number of reviews for a tenant
    function getReviewCount(address tenant) external view returns (uint) {
        return tenantReviews[tenant].length;
    }
    
    function getAverageRating(address tenant) external view returns (uint) {
        Review[] memory reviews = tenantReviews[tenant];
        
        if (reviews.length == 0) {
            return 0;
        }
        
        uint totalRating = 0;
        for (uint i = 0; i < reviews.length; i++) {
            totalRating += reviews[i].rating;
        }
        
        return totalRating / reviews.length;
    }
}

